// Dependencies
import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <h1>Home Page</h1>
        <img src="./Home.jpg" alt="Fede Luna"/>
      </div>
    );
  }
}

export default Home;
